import React from 'react';
import styled from 'styled-components';

function SocialMain() {
  const Main = styled.div `
    background: #fff;
    padding: 25px 50px;
    margin-bottom: 60px;
    text-align:left
  `;

  const MainName = styled.h3 `
    margin: 0 0 1.25em;
  `;

  const MainText = styled.p `
    display: block;
    margin: 0 0 1.25em;
    line-height: 1.625;
  `;

  return (
    <Main>
      <MainName>Social</MainName>
      <MainText>アカウントです。</MainText>
    </Main>
  );
}

export default SocialMain;
